      subtitle = "Ordenado pela Mediana de Preço. Escala Logarítmica.",
      x = NULL,
      y = "Valor da Terra (R$/ha)"
    ) +

    theme_minimal() +
    theme(
      axis.text.y = element_text(size = 8, face = "bold"),
      panel.grid.minor = element_blank()
    )

  # D. O comando essencial para loops:
  print(p)
}
